import Errors from '../img/error.png';
import AuthService from '../servicios/AuthService';
import './styles.css'

 const Noencontrado =({onAuthChange, onGenerar})=>{
const _onGenerar=(e)=>{
    e.preventDefault()
    onGenerar()
}

    return(<div className="notfound-bg" style={{textAlign:'center'}}>
        <strong style={{display:'block'}}>No cuenta con materias asignadas en el actual periodo </strong>
        <button onClick={_onGenerar}>Login</button>
          </div>
    );
}
export default Noencontrado;
